import React from "react";
import { Link } from "react-router-dom";

function AboutPage() {
  return (
    <div className="about">
      <h1>About This Project</h1>
      <p>This is a REact app to leave feedback for a product or service</p>
      <p>Version: 1.0.0</p>

      <p>
        <Link to="/">Back to home</Link>
      </p>
    </div>
  );
}

export default AboutPage;
